import Link from "next/link";

function Nav(){
    const {colors} = this.props;
     
    return (
        <nav className="top__menu" style={{backgroundColor: "white"}}>
            <span></span>
            <ul>
                <Link href="/login">
                    <button className="pub only__border">Fazer login</button>
                </Link>
            </ul>
        </nav>
    )
}

export default Nav;
